//import logo from './logo.svg';
import React, { Component } from "react";
import './App.css';

class HourBlock extends Component { 
  render() {
    return (
      <div className='card p-3'>
        <div className="row-time">
          <div className='card p-3'>
            <div className='column-time'>
              {this.props.hourCounter}
            </div>
          </div>
          <div className='card p-3'>
            <div className='column-space'>
              {this.props.spaceText}
            </div>
          </div>
        </div>  
      </div>
    ); }
  }

function App() {
  return (
    <div>
      <main className="container">
        <div className='header-box'>
          <h1 className="text-Black text-uppercase text-center my-4">BAKE BUDDY</h1>
        </div>
        <div className='row'>
          <div className='column'>
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <div className="card p-3">
                Some Text in Column One
              </div>
            </div>
          </div>
          <div className='column'>
            <div className='scroll-column'>
              <HourBlock 
                hourCounter = '5'
                spaceText = 'BAKE'
              />
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
